import React from "react";

function PaginaInicio() {
  return (
    <div className="text-center mt-10">
      <h1 className="text-3xl font-bold text-blue-700 mb-4">Bienvenido al Sistema de Facturación</h1>
      <p className="text-gray-600">
        Usá la barra de navegación para registrar productos, ventas, clientes y vendedores.
      </p>
    </div>
  );
}

export default PaginaInicio;
